// import { useState } from "react";
import "./App.css";
import "./style.css";

function App() {
  const [resourceType, setResourceType] = useState("");
  const [items, setItems] = useState([]);
  useEffect(() => {
    fetch('https://archive.org/metadata/TheAdventuresOfTomSawyer_201303')
    .then (response=>response.json())
    .then(json=>setItems(json))
  }, [resourceType]);
  return (
    <div className="App">
      <div className="container" onClick={() => setResourceType("post1")}>
        POST
      </div>
      <div className="container" onClick={() => setResourceType("post2")}>
        POST
      </div>
      <h1>{resourceType}</h1>
    {items.map(item =>{
      return <pre>{JSON.stringify(item)}</pre>})}<></>
    </div>
  );
}

export default App;
